import TheHome from './components/TheHome';
import TheSignup from './components/TheLogin';
import TheLogin from './components/TheSignup';

const routes = [
    {
        path: '/',
        name: 'TheHome',
        component: Home,
    },
    {
        path: '/TheSignup',
        name: 'TheSignup',
        component: TheSignup,
    },
    {
        path: '/TheLogin',
        name: 'TheLogin',
        component: TheLogin,
    },
];

export default routes;
